          // \u5C06thread-loader \u653E\u7F6E\u5728\u5176\u4ED6loader \u4E4B\u524D\uFF0C\u4E4B\u540E\u7684loader \u4F1A\u5728\u4E00\u4E2A\u72EC\u7ACB\u7684worker\u6C60\u4E2D\u8FD0\u884C\u3002
          // \u5F00\u542F\u591A\u7EBF\u7A0B\u9700\u8981\u542F\u52A8\u65F6\u95F4\uFF0C\u5927\u7EA6600ms\u5DE6\u53F3\uFF0C\u6240\u4EE5\u9002\u5408\u89C4\u6A21\u6BD4\u8F83\u5927\u7684\u9879\u76EE\u3002
